const Likes = (props) => {

    return(
        <div className='likes'>
            <img src={'https://cdn.pixabay.com/photo/2017/07/25/01/22/cat-2536662_960_720.jpg'} alt='kitten playing'/>
            <div className="likesCount">
                <h3>{props.count} likes</h3>
                <button className='like' type='submit' onClick= {() => setCount(prop.count + 1)}>Like</button>
                <button onClick ={() => setCount(0)}>reset</button>
                <button className='like' type='submit' onClick= {() => setCount(prop.count - 1)}>Disike</button>
            </div>
        </div>
    );
};

export default Likes;
